private NumberSeq findAssetIdNumberSeq()
{
    NumberSeq       assetNumberSeq;

    this.setAssetGroup();

    //Check if asset group set
    if (this.isFieldSet(fieldNum(AssetTable, AssetGroup)))
    {
        assetNumberSeq = AssetGroup::getNumberSeqForGroup(this.parmAssetGroup());
    }

    return assetNumberSeq;
}

protected void initMandatoryFieldsExemptionList()
{
    super();
    this.setParmMethodAsNotMandatory(methodstr(AxAssetTable,parmAssetId));
    this.setParmMethodAsNotMandatory(methodstr(AxAssetTable,parmAssetGroup));
}

