[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
public str parmInsuranceVendor(str _insuranceVendor = '')
{
    DictField   dictField;
    ;
    if (!prmisdefault(_insuranceVendor))
    {
        dictField = new DictField(tablenum(AssetTable),fieldnum(AssetTable,InsuranceVendor));
        if (this.valueMappingInbound())
        {
            this.validateInboundString(_insuranceVendor,dictField,this.mapPolicy().xMLMapVendAccount());
            _insuranceVendor = this.axVendAccount(_insuranceVendor);
        }
        else
        {
            this.validateInboundString(_insuranceVendor,dictField);
        }
        this.setField(fieldnum(AssetTable, InsuranceVendor), _insuranceVendor);
    }

    if (this.valueMappingOutbound())
    {
        return this.axVendAccount(assetTable.InsuranceVendor);
    }
    else
    {
        return assetTable.InsuranceVendor;
    }
}

