[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
protected void setAssetGroup()
{
    AxAssetTable    localAssetTable = this.axOrig();
    if (this.isSetMethodsCalledFromUpdate() || this.isSetMethodsCalledFromModify())
    {
        if ((this.parmAssetGroup()) && (this.parmAssetGroup() != localAssetTable.assetTable().AssetGroup))
        {
            throw(error("@SYS115832"));
        }
    }

    if (this.isMethodExecuted(funcname(), fieldnum(AssetTable, AssetGroup)))
    {
        return;
    }
}

[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
protected void setAssetId()
{
    NumberSeq assetNumberSeq;
    NumberSequenceTable numberSequenceTable;
    AxAssetTable localAssetTable = this.axOrig();

    if (this.isSetMethodsCalledFromUpdate() || this.isSetMethodsCalledFromModify())
    {
        if (this.parmAssetId() && this.parmAssetId() != localAssetTable.assetTable().AssetId)
        {
            throw(error("@SYS115824"));
        }
    }

    if (this.isMethodExecuted(funcName()))
    {
        return;
    }

    if (this.isSetMethodsCalledFromSave())
    {
        assetNumberSeq = this.findAssetIdNumberSeq();

        if (assetNumberSeq)
        {
            if (this.isFieldSetExternally(fieldNum(AssetTable, AssetId)))
            {
                if (!this.assetTable())
                {
                    numberSequenceTable = NumberSequenceTable::find(assetNumberSeq.parmNumberSequenceId());
                    this.checkNumber(numberSequenceTable, fieldNum(AssetTable, AssetId), this.parmAssetId());

                    if (assetNumberSeq.parmNumberSequenceId() && numberSequenceTable.Continuous)
                    {
                        assetNumberSeq.reserve(this.parmAssetId());
                    }
                }
            }
            else
            {
                if (this.isFieldSet(fieldNum(AssetTable, AssetId)))
                {
                    return;
                }

                if (!this.parmAssetId())
                {
                    this.parmAssetId(assetNumberSeq.num());
                }
            }
        }
    }

    assetIdNumberSeq = assetNumberSeq;
    assetIdAllocated = this.parmAssetId();
}

