[Microsoft.Dynamics.BusinessPlatform.SharedTypes.InternalUseOnlyAttribute]
protected void setBarcode()
{
    AssetParameters assetParameters = AssetParameters::find();
    AssetGroup assetGroup = AssetGroup::find(this.parmAssetGroup());
    NumberSeq       assetBarcodeNumberSeq;
    AxAssetTable    localAssetTable = this.axOrig();
    ;

    if ((assetParameters.BarcodeEqualsAssetNumber) && (this.parmBarcode() != localAssetTable.assetTable().Barcode))
    {
        throw(error(strfmt("@SYS115825", "@SYS24296", "@SYS67374")));
    }

    if (this.isMethodExecuted(funcname(), fieldnum(AssetTable, Barcode)))
    {
        return;
    }

    //Check to see if Barcode equals Fixed Asset Number
    if (assetParameters.BarcodeEqualsAssetNumber)
    {
        //Set AssetId first
        this.setAssetId();

        //Check if AssetId is set
        if (this.isFieldSet(fieldnum(AssetTable,AssetId)))
        {
            this.parmBarcode(this.assetTable().AssetId);
        }
    }
    else
    {
        // Check to see if Autonumber barcodes
        if (!assetParameters.BarcodeEqualsAssetNumber &&
             assetGroup.AutoNumberBarcode             &&
             assetGroup.BarcodeNumberSequenceTable)
        {
            assetBarcodeNumberSeq = NumberSeq::newGetNumFromId(assetGroup.BarcodeNumberSequenceTable, true);
            this.parmBarcode(assetBarcodeNumberSeq.num());
            assetBarcodeNumberSeq.used();
        }
    }
}

