/// <summary>
///   Saves the record.
/// </summary>
protected void write()
{
    if (assetIdNumberSeq && this.parmAssetId() == assetIdAllocated)
    {
        assetIdNumberSeq.used();
    }
    else
    {
        if (assetIdNumberSeq)
        {
            assetIdNumberSeq.abort();
        }
    }

    super();
}

